import React, {useState, useEffect} from 'react';
import Header from '../../components/Header';
import Sidebar from '../../components/Sidebar';
import Footer from '../../components/Footer';
import { useNavigate } from 'react-router-dom';
import { useLocation } from 'react-router-dom';

const AssignCharger = ({ userInfo, handleLogout }) => {
    const location = useLocation();
    const dataItem = location.state?.dataItem;    

    const [data, setData] = useState([]);

    useEffect(() => {
        const fetchAssignedClients = async () => {
            alert(dataItem.reseller_id);

            try {
                const response = await fetch('/superadmin/FetchAssignedClients', {
                    method: 'POST',
                    headers: {
                        'Content-Type': 'application/json',
                    },

                    body: JSON.stringify({ reseller_id: dataItem.reseller_id }),
                });
                if (response.ok) {
                    const data = await response.json();
                    console.log('Response assign charger:', data);
                    setData(data);
                } else {
                    console.error('Failed to assign charger');
                }
            } catch (error) {
                console.error('An error occurred while adding the charger');
                console.error('Error:', error);
            }
        };
        if (dataItem?.reseller_id) {
            fetchAssignedClients();
        } else {
            console.error('Reseller ID not found in dataItem');
        }
    }, [dataItem?.reseller_id]);

    const navigate = useNavigate();

    const backManageReseller = () => {
        navigate('/superadmin/ManageReseller');
    };

    const handleSessionHistory = () => {
        navigate('/superadmin/SessignHistory');
    };

    const [filteredData] = useState([]);
    const [posts, setPosts] = useState([]);

     // Search data 
     const handleSearchInputChange = (e) => {
        const inputValue = e.target.value.toUpperCase();
        // Ensure data is an array before filtering
        if (Array.isArray(data)) {
            const filteredData = data.filter((item) =>
                item.reseller_name.toUpperCase().includes(inputValue)
            );
            // Update the search state with the filtered results
            setPosts(filteredData);
        }
    };

    // Update table data 'data', and 'filteredData' 
    useEffect(() => {
        switch (data) {
            case 'filteredData':
                setPosts(filteredData);
                break;
            default:
                setPosts(data);
                break;
        }
    }, [data, filteredData]);

    // Timestamp data 
    function formatTimestamp(originalTimestamp) {
        const date = new Date(originalTimestamp);
        const day = String(date.getDate()).padStart(2, '0');
        const month = String(date.getMonth() + 1).padStart(2, '0');
        const year = date.getFullYear();

        let hours = date.getHours();
        const minutes = String(date.getMinutes()).padStart(2, '0');
        const seconds = String(date.getSeconds()).padStart(2, '0');
        const ampm = hours >= 12 ? 'PM' : 'AM';
        hours = hours % 12;
        hours = hours ? hours : 12; // the hour '0' should be '12'
        hours = String(hours).padStart(2, '0');

        const formattedDate = `${day}/${month}/${year} ${hours}:${minutes}:${seconds} ${ampm}`;
        return formattedDate;
    } 
    return (
        <div className='container-scroller'>
            {/* Header */}
            <Header userInfo={userInfo} handleLogout={handleLogout} />
            <div className="container-fluid page-body-wrapper">
                {/* Sidebar */}
                <Sidebar/>
                <div className="main-panel">
                    <div className="content-wrapper">
                        <div className="row">
                            <div className="col-md-12 grid-margin">
                                <div className="row">
                                    <div className="col-12 col-xl-8 mb-4 mb-xl-0">
                                        <h3 className="font-weight-bold">Assign Charger's</h3>
                                    </div>
                                    <div className="col-12 col-xl-4">
                                        <div className="justify-content-end d-flex">
                                            <button type="button" className="btn btn-success" onClick={backManageReseller}>Back</button>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div className="row">
                            <div className="col-lg-12 grid-margin stretch-card">
                                <div className="card">
                                    <div className="card-body">
                                        <div className="row">
                                            <div className="col-md-12 grid-margin">
                                                <div className="row">
                                                    <div className="col-4 col-xl-8">
                                                        <h4 className="card-title" style={{paddingTop:'10px'}}>List Of Charger's</h4>  
                                                    </div>
